class Solution(object):
    def minimumTeachings(self, n, languages, friendships):
        """
        :type n: int
        :type languages: List[List[int]]
        :type friendships: List[List[int]]
        :rtype: int
        """
        # pre-process
        taught_languages = list()
        for language in languages:
            taught_languages.append(set(language))

        from collections import defaultdict
        communicable = defaultdict(dict)
        for friendship in friendships:
            friend, friend2 = friendship
            if taught_languages[friend - 1] & taught_languages[friend2 - 1]:
                communicable[friend][friend2] = True
            else:
                communicable[friend][friend2] = False

        # process
        from copy import deepcopy
        ans = float("inf")
        count = 0
        for x in range(1, n + 1):
            teachings = 0
            taught_languages = list()
            for language in languages:
                taught_languages.append(set(language))

            for friendship in friendships:
                friend, friend2 = friendship
                # friend and friend2 has the same language to communicate
                if communicable[friend][friend2]:
                    pass
                # otherwise, teach language x to them
                else:
                    if x not in taught_languages[friend - 1]:
                        teachings += 1
                        taught_languages[friend - 1].add(x)
                    if x not in taught_languages[friend2 - 1]:
                        teachings += 1
                        taught_languages[friend2 - 1].add(x)
            ans = min(ans, teachings)
        return ans


